                </template>
                <el-row :span="5" class="header-right">
                    <el-dropdown trigger="hover">
                        <span class="el-dropdown-link userinfo-inner"><img src="../../assets/images/use.png" /></span>
                        <el-dropdown-menu slot="dropdown">
                            <span @click="user()"><el-dropdown-item ><div >{{userAccount}}</div><div>{{name}}</div></el-dropdown-item></span>
                            <!--<el-dropdown-item>我的消息</el-dropdown-item>-->
                            <span @click="changePassword()"><el-dropdown-item >修改密码</el-dropdown-item></span>
