</template>

<script>
    import Vue from 'vue';
    import { mapGetters } from 'vuex';
    import Levelbar from './Levelbar';
    import Hamburger from '@/components/Hamburger';
    import store from '@/store'
    import dashboard from '../dashboard/index'
    import modifyPassword from '../dashboard/modifyPassword.vue'

    Vue.component('my-item-zh', {
        functional: true,
        render: function (h, ctx) {
            var item = ctx.props.item;
            return h('li', ctx.data, [
                h('div', { attrs: { class: 'name' } }, [item.value]),
                h('span', { attrs: { class: 'addr' } }, [item.address])
            ]);
        },
        props: {
            item: { type: Object, required: true }
        }
    });
    export default {
        components: {
            Hamburger
        },
        //导航钩子
        beforeRouteEnter (to, from, next) {
            let toPath = to.path;
            next();
            let arr=toPath.split("/");
            let arrPath = '/'+arr[1];
        },
        data() {
            return {
                activeIndex: '1',
                activeIndex2: '1',
                input2:'',
                restaurants: [],
                state3: '',
                isActive:true,
            };
        },
        methods: {
            changePassword(){
                let data = {
                    component: modifyPassword,
                    name: '修改密码'
                };
                this.$root.hubBus.$emit('menuClick', data);
            },
            user(){
                let data = {
                    component: dashboard,
                    name: '用户详情'
                };
                this.$root.hubBus.$emit('menuClick', data);
            },
            querySearch(queryString, cb) {
                var restaurants = this.restaurants;
                var results = queryString ? restaurants.filter(this.createFilter(queryString)) : restaurants;
                // 调用 callback 返回建议列表的数据
                cb(results);
            },
            createFilter(queryString) {
                return (restaurant) => {
                    return (restaurant.value.indexOf(queryString.toLowerCase()) === 0);
                };
            },
            loadAll() {
                return [
                    { "value": "牌证管理", "address": "这里是牌证管理" },
                    { "value": "教务管理", "address": "这里是教务管理" },
                    { "value": "牌证管理", "address": "这里是牌证管理" },
                    { "value": "教务管理", "address": "这里是教务管理" },
                ];
            },
            handleSelect(item) {
               // console.log(item);
            },
            handleIconClick(ev) {
                //console.log(ev);
            },
            logout() {
               /* this.$store.dispatch('LogOut').then(() => {
                    location.reload();  // 为了重新实例化vue-router对象 避免bug
                });*/
                 this.$store.dispatch('FedLogOut').then(() => {
                     location.reload();  // 为了重新实例化vue-router对象 避免bug
                 });
            },
            toggleSideBar() {
                this.$store.dispatch('ToggleSideBar');
              //  console.log(this.sidebar.opened)
            }
        },
        mounted() {
            this.restaurants = this.loadAll();
            //console.log(window.location.pathname )
        },
        created(){
          // console.log(store.getters.addRouters)
        },
        computed: {
            ...mapGetters([
                'addRouters',
                'sidebar',
                'name',
                'userAccount'
            ])
        },
    }
</script>

